import { BrowserRouter as Router, 
  Route,
  Routes,
  Link
} from 'react-router-dom'

import Home from '../src/Screens/Home'
import Promotions from '../src/Screens/Promotions'
import Contact from './Screens/Contact';
import Footer from './Screens/Footer';
import Map from './Screens/Map';
import Rooms from './Screens/Rooms';
import Service from './Screens/Service';
import { render } from '@headlessui/react/dist/utils/render';
import { Header } from 'react-native/Libraries/NewAppScreen';

class App extends React.Component{

  constructor(props) {
    super(props)
    this.state = {}
  }

  render() {
    return (
      <BrowserRouter>
        <Header></Header>
        <div className="App bg-background-color text-text-color font-normal text-subtitle-font-size font-body-font subpixel-antialiased">
          <header className="text-title-color grid flex-col place-content-center">
            <h1 className="">Karaoke Paulista</h1>
          </header>

          <Link to="/">Início</Link>
          <Link to="/promotions">Promoções</Link>
          <Link to="/rooms">Salas</Link>
          <Link to="/services">Cardapio</Link>
          <Link to="/map">Mapa</Link>
          <Link to="/contact">Contato</Link>

          <Routes>
            <Route path='/' exact>
              <Home/>
              <div className='flex-col divide-y-0 bg-base-color h-[1px]'></div>
            </Route>
            <Route path='/promotions'>
              <Promotions/>
              <div className='flex-col divide-y-0 bg-base-color h-[1px]'></div>
            </Route>
            <Route path='/rooms'>
              <Rooms/>
              <div className='flex-col divide-y-0 bg-base-color h-[1px]'></div>
            </Route>
            <Route path='/service'>
              <Service/>
              <div className='flex-col divide-y-0 bg-base-color h-[1px]'></div>
            </Route>
            <Route path='/map'>
              <Map/>  
              <div className='flex-col divide-y-0 bg-base-color h-[1px]'></div>
            </Route>
            <Route path='/contact'>
              <Contact/>
              <div className='flex-col divide-y-0 bg-base-color h-[1px]'></div>
            </Route>
              {/* <Footer /> */}
          </Routes>

        </div>
      </BrowserRouter>
    );
  }
}


export default App;
